defines.colored_text = function(...)
    local data = {...}
    local str = ""

    for k, v in pairs(data) do
        local text = v[1]
        local clr = ""

        if text:find("icon_") then
            text = ui.get_icon(text:gsub("icon_", ""))
        end

        text = text or "nil"

        if v[2] == nil then
            v[2] = "DEFAULT"
        end

        if type(v[2]) == "userdata" then
            v[2] = v[2]:to_hex()
            clr = ("\a%s"):format(v[2])
        else
            clr = "\a" .. v[2]
        end

        str = str .. clr .. text
    end

    return str
end

defines.centered_text = function(str)
    local space = ""

    if #str > 44 then
        return ""
    end


    for i = 1, 44 - #str do
        space = space .. "\x20"
    end

    return space
end

defines.get_bind = function(name)
    local state = false
    local value = 0
    local binds = ui.get_binds()
    for i = 1, #binds do
        if binds[i].name == name and binds[i].active then
            state = true
            value = binds[i].value
        end
    end
    return {state, value}
end

