screen_indication.handle = function()
    local anim = {}

    local indication_enable =       ui_handler.elements["interface"]["screen_indication"]
    local indication_stars =        ui_handler.elements["interface"]["screen_indication_additional"]["Stars"]
    local indication_lua_build =    ui_handler.elements["interface"]["screen_indication_additional"]["Lua Build"]
    local indication_lua_name =     ui_handler.elements["interface"]["screen_indication_additional"]["Lua Name"]
    local indication_state =        ui_handler.elements["interface"]["screen_indication_additional"]["Anti-Aim State"]
    local indication_keybinds =     ui_handler.elements["interface"]["screen_indication_additional"]["Keybinds"]
    local indication_stars_color =  ui_handler.elements["interface"]["screen_indication_stars_color"]
    local indication_accent_color = ui_handler.elements["interface"]["screen_indication_accent_color"]
    local indication_breath_color = ui_handler.elements["interface"]["screen_indication_breath_color"]

    anim.main = animations.new("screen_indication_main", indication_enable and 255 or 0)

    if anim.main < 1 then
        return
    end

    local player = entity.get_local_player()

    if player == nil or not player:is_alive() then
        return
    end

    local scope_based = (not (ui_handler.elements["interface"]["scope_overlay_settings"]["Rotated"] and ui_handler.elements["interface"]["scope_overlay"]) and player.m_bIsScoped)
    
    local add_y = animations.new("adding_anim", 25 + (ui_handler.elements["interface"]["scope_overlay"] and ui_handler.elements["interface"]["scope_overlay_settings"]["Rotated"] and 15 or 0))

    local ping = player:get_resource().m_iPing
    local delta = (math.abs(ping % 360)) / (neverlose_refs.fake_latency:get() / 2)
    if delta > 1 then delta = 1 end

    local ping_color = color(255 - (125 * delta), 200 * delta, 0)

    local states = {
        [-1] = "unknown",
        [1] = "shared",
        [2] = "standing",
        [3] = "moving",
        [4] = "slowwalk",
        [5] = "crouch",
        [6] = "air",
        [7] = "air crouch"
    }

    anim.states = {}
    anim.states.len = animations.new("states_len", #states[conditional_antiaims.player_state], 0.3)

    local binds = {
        {"freestand", indication_keybinds and ui_handler.elements["aa"]["manuals"] == "Freestanding", colors.white},
        {"hitchance", indication_keybinds and defines.get_bind("Hit Chance")[1], colors.white},
        {"damage", indication_keybinds and defines.get_bind("Min. Damage")[1], colors.white},
        {"dt", indication_keybinds and neverlose_refs.doubletap:get(), color(255, 255, 255, 150)},
        {"hide", indication_keybinds and neverlose_refs.hideshots:get() and not neverlose_refs.doubletap:get(), colors.white},
        {"safe", indication_keybinds and neverlose_refs.prefer_safety:get() == "Force", colors.white},
        {"body", indication_keybinds and neverlose_refs.prefer_body:get() == "Force", colors.white},
        {"state", indication_state, colors.white}
    }

    local text_size = render.measure_text(1, nil, "testarossa.tech").x

    anim.stars = {}
    anim.stars.add = animations.new("stars_add", indication_enable and indication_stars and 17 or 0)
    anim.stars.move = animations.new("stars_move", scope_based and -5 or 30)
    
    anim.stars.x_tbl = {10, 0, 10, 19, 35, 27, 42, 45, 53}
    anim.stars.y_tbl = {10, 5, 2, 3, 2, 8, 8, 0, 10}

    for i = 1, #anim.stars.x_tbl do
        anim.stars.alpha = {}
        anim.stars.alpha[i] = animations.new("stars_alpha_" .. i, indication_enable and indication_stars and (globals.realtime%(1.5*i) > 0.75*i and 255 or 100) or 0)

        if anim.stars.alpha[i] > 1 then
            render.texture(
                screen_indication.star, 
                defines.screen_size / 2 + vector(anim.stars.x_tbl[i], add_y + anim.stars.y_tbl[i]) - vector(anim.stars.move, 0), 
                vector(7,7), 
                indication_stars_color:override("a", anim.stars.alpha[i])
            )
        end
    end
    add_y = add_y + anim.stars.add

    anim.lua_name = {}
    anim.lua_name.alpha = animations.new("lua_name_alpha", indication_enable and indication_lua_name and 255 or 0)
    anim.lua_name.text = gradient.text_animate("testarossa.tech", -3, {indication_accent_color, indication_breath_color})
    anim.lua_name.move = animations.new("lua_main_move", scope_based and -5 or text_size / 2)
    if anim.lua_name.alpha > 1 then
        render.shadow(defines.screen_size / 2 - vector(anim.lua_name.move, -add_y - 7), defines.screen_size / 2 - vector(anim.lua_name.move, -add_y - 7) + vector(text_size, 0), indication_accent_color:override("a", anim.lua_name.alpha), 20, 0)
        render.text(
            1,
            defines.screen_size / 2 - vector(anim.lua_name.move, -add_y),
            colors.white:override("a", anim.lua_name.alpha),
            nil,
            anim.lua_name.text:get_animated_text()
        )

        anim.lua_name.text:animate()

        add_y = add_y + anim.lua_name.alpha / 255 * 10
    end

    local text = ""

    anim.binds = {}

    for k, v in pairs(binds) do
        if v[1] == "state" then
            text = "-" .. states[conditional_antiaims.player_state]:sub(0, anim.states.len) .. "-"
        elseif v[1] == "dt" then
            text = defines.colored_text({"dt ", }, {rage.exploit:get() == 1 and (conditional_antiaims.defensive and "active" or "ready") or "waiting", rage.exploit:get() == 1 and colors.white or color(255, 100, 100, 150)})
        else
            text = v[1]
        end

        anim.binds[v[1]] = {}
        anim.binds[v[1]].alpha = animations.new("binds_alpha_"..v[1], indication_enable and v[2] and 255 or 0)
        anim.binds[v[1]].move = animations.new("binds_move_"..v[1], not scope_based and render.measure_text(1, nil, text).x/2 or -5)
        
        if anim.binds[v[1]].alpha > 1 then
            render.text(1, defines.screen_size / 2 - vector(anim.binds[v[1]].move, -add_y), v[3]:override("a", anim.binds[v[1]].alpha), nil, text)

            add_y = add_y + anim.binds[v[1]].alpha / 255 * 10
        end
    end
end

