velocity_indication.handle = function()
    local player = entity.get_local_player()

    if player == nil then
        return
    end

    local velocity_indication_enable = ui_handler.elements["interface"]["velocity_indication"]
    local velocity_indication_color = ui_handler.elements["interface"]["velocity_indication_color"]
    local defensive_indication_enable = ui_handler.elements["interface"]["defensive_indication"]
    local defensive_indication_color = ui_handler.elements["interface"]["defensive_indication_color"]
    local pos = vector(ui_handler.elements["drag"]["velocity_indication_pos_x"], ui_handler.elements["drag"]["velocity_indication_pos_y"])

    local m_flVelocityModifier = animations.new("m_flVelocityModifier", ui.get_alpha() > 0 and player.m_flVelocityModifier == 1 and 0.5 or player:is_alive() and player.m_flVelocityModifier or 1)
    local m_flDefensiveModifier = animations.new("m_flDefensiveModifier", ui.get_alpha() > 0 and not neverlose_refs.doubletap:get() and 1 or (conditional_antiaims.defensive and 0 or 1) or 1)

    local anim = {}

    local add_y = 0

    local size = vector(120, 0)

    anim.drag = animations.new("anim_drag", (velocity_indication_enable or defensive_indication_enable) and ui.get_alpha() > 0.5 and 255 or 0)

    anim.defensive = animations.new("defensive_indication", defensive_indication_enable and (neverlose_refs.doubletap:get() or ui.get_alpha() > 0.5) and 255 or 0)

    size.y = size.y + anim.defensive/255*29

    if anim.defensive > 1 then
        local text = defines.colored_text({"defensive: "}, {(conditional_antiaims.defensive and "active" or "ready"), defensive_indication_color})
        render.text(1, vector(pos.x + 20, pos.y + 5), colors.white:override("a", anim.defensive), nil, text)
        render.shadow(vector(pos.x + 4, pos.y + 19), vector(pos.x + 126, pos.y + 25), defensive_indication_color:override("a", anim.defensive), 20, 0)
        render.rect(vector(pos.x + 4, pos.y + 19), vector(pos.x + 126, pos.y + 25), colors.black:override("a", anim.defensive/2), 2)
        render.rect(vector(pos.x + 5, pos.y + 20), vector(pos.x + m_flDefensiveModifier*120 + 5, pos.y + 24), defensive_indication_color:override("a", anim.defensive), 2)
    end

    add_y = add_y + anim.defensive/255*29

    anim.velocity = animations.new("velocity_indication", velocity_indication_enable and (ui.get_alpha() > 0.5 and 255 or m_flVelocityModifier < 0.9 and 255 or 0) or 0)

    size.y = size.y + anim.velocity/255*29

    if anim.velocity > 1 then
        local text = defines.colored_text({"Slowed down "}, {tostring(math.floor(m_flVelocityModifier*100)), velocity_indication_color}, {"%"})
        render.text(1, vector(pos.x + 20, pos.y + add_y + 5), colors.white:override("a", anim.velocity), nil, text)
        render.shadow(vector(pos.x + 4, pos.y + add_y + 19), vector(pos.x + 126, pos.y + add_y + 25), velocity_indication_color:override("a", anim.velocity), 20, 0)
        render.rect(vector(pos.x + 4, pos.y + add_y + 19), vector(pos.x + 126, pos.y + add_y + 25), colors.black:override("a", anim.velocity/2), 2)
        render.rect(vector(pos.x + 5, pos.y + add_y + 20), vector(pos.x + m_flVelocityModifier*120 + 5, pos.y + add_y + 24), velocity_indication_color:override("a", anim.velocity), 2)
    end

    if anim.velocity > 1 or anim.defensive > 1 then
        drag.handle(pos.x, pos.y, size.x + 10, size.y + 10, "velocity_indication", anim.drag)

        anim.menu = animations.new("velocity_indication_menu", (velocity_indication_enable or defensive_indication_enable) and ui.get_alpha() > 0.5 and 255 or 0)
        if anim.menu > 1 then
            render.text(1, vector(pos.x, pos.y + size.y + 14), colors.white:override("a", anim.menu), nil, "Press M2 to center.")
        end
        
        if common.is_button_down(0x02) and drag.in_bounds(vector(0, 0), defines.screen_size) and drag.in_bounds(pos, pos + size + 10) then
            ui_handler.refs["drag"]["velocity_indication_pos_x"].ref:set(defines.screen_size.x/2 - (size.x/2 + 5))
        end
    end
end

