aimbot_logger.get = function(shot)
    if ui_handler.elements["interface"]["aimbot_logger"] then

        aimbot_logger.shots = aimbot_logger.shots + 1

        local aimbot_logger_settings = ui_handler.elements["interface"]["aimbot_logger_settings"]
        local hit_color =      "\a" .. ui_handler.elements["interface"]["aimbot_logger_hit_color"]:to_hex():sub(0, 6)
        local miss_color =     "\a" .. ui_handler.elements["interface"]["aimbot_logger_miss_color"]:to_hex():sub(0, 6)
        
        local dickpickovaya_dama = ("%i%s"):format(aimbot_logger.shots, aimbot_logger.count[aimbot_logger.shots] or "th")

        if shot.state == nil then
            if aimbot_logger_settings["Console"] then
                print_raw(
                    (hit_color.."%s\aFFFFFF \a878787|\aFFFFFF Registered shot in %s\'s "..hit_color.."%s\aFFFFFF for "..hit_color.."%s\aFFFFFF("..hit_color.."%s\aFFFFFF) (hitchance: "..hit_color.."%s%% \aFFFFFF| history(Δ): "..hit_color.."%s \aFFFFFF| flags: "..hit_color.."%s%s\aFFFFFF)"):format(
                    "testarossa.tech", shot.target:get_name(), aimbot_logger.hitboxes[shot.hitgroup+1], shot.damage, shot.wanted_damage, shot.hitchance, shot.backtrack, (neverlose_refs.doubletap:get() and 1 or 0), (neverlose_refs.hideshots:get() and 1 or 0))
                )
            end

            if aimbot_logger_settings["Custom"] then
                print_dev(
                    (hit_color.."%s\aFFFFFF \a878787|\aFFFFFF Registered shot in %s\'s "..hit_color.."%s\aFFFFFF for "..hit_color.."%s\aFFFFFF("..hit_color.."%s\aFFFFFF) (hitchance: "..hit_color.."%s%% \aFFFFFF| history(Δ): "..hit_color.."%s \aFFFFFF| flags: "..hit_color.."%s%s\aFFFFFF)"):format(
                    "testarossa.tech", shot.target:get_name(), aimbot_logger.hitboxes[shot.hitgroup+1], shot.damage, shot.wanted_damage, shot.hitchance, shot.backtrack, (neverlose_refs.doubletap:get() and 1 or 0), (neverlose_refs.hideshots:get() and 1 or 0))
                )
            end

            if aimbot_logger_settings["Notify"] then
                table.insert(aimbot_logger.data, {
                    {
                        shot.target:is_alive() and "Hit " or "Killed ",
                        tostring(shot.target:get_name()),
                        " in ",
                        tostring(aimbot_logger.hitboxes[shot.hitgroup+1]),
                        " for ",
                        tostring(shot.damage),
                        " damage (",
                        tostring(math.max(0, shot.target.m_iHealth)),
                        " hp remaining)",
                    },
                    alpha = 0, 
                    alpha1 = 0,
                    time = globals.realtime,
                    color = ui_handler.elements["interface"]["aimbot_logger_hit_color"]
                })
            end
        else
            if aimbot_logger_settings["Console"] then
                print_raw(
                    (miss_color.."%s \a878787|\aFFFFFF Missed shot in %s\'s "..miss_color.."%s\aFFFFFF due to "..miss_color.."%s\aFFFFFF (hitchance: "..miss_color.."%s%% \aFFFFFF| history(Δ): "..miss_color.."%s \aFFFFFF| flags: "..miss_color.."%s%s\aFFFFFF)"):format(
                    "testarossa.tech", shot.target:get_name(), aimbot_logger.hitboxes[shot.wanted_hitgroup+1], shot.state, shot.hitchance, shot.backtrack, (neverlose_refs.doubletap:get() and 1 or 0), (neverlose_refs.hideshots:get() and 1 or 0))
                )
            end

            if aimbot_logger_settings["Custom"] then
                print_dev(
                    (miss_color.."%s \a878787|\aFFFFFF Missed shot in %s\'s "..miss_color.."%s\aFFFFFF due to "..miss_color.."%s\aFFFFFF (hitchance: "..miss_color.."%s%% \aFFFFFF| history(Δ): "..miss_color.."%s \aFFFFFF| flags: "..miss_color.."%s%s\aFFFFFF)"):format(
                    "testarossa.tech", shot.target:get_name(), aimbot_logger.hitboxes[shot.wanted_hitgroup+1], shot.state, shot.hitchance, shot.backtrack, (neverlose_refs.doubletap:get() and 1 or 0), (neverlose_refs.hideshots:get() and 1 or 0))
                )
            end

            if aimbot_logger_settings["Notify"] then
                table.insert(aimbot_logger.data, {
                    {
                        "Missed ",
                        tostring(shot.target:get_name()),
                        " in the ",
                        tostring(aimbot_logger.hitboxes[shot.wanted_hitgroup+1]),
                        " due to ",
                        tostring(shot.state),
                        "",
                        "",
                        "",
                    },
                    alpha = 0,
                    alpha1 = 0,
                    time = globals.realtime,
                    color = ui_handler.elements["interface"]["aimbot_logger_miss_color"]
                })
            end
        end
    end
end

