model_breaker.update = safecall("model_breaker.update", true, function(thisptr, edx)
    hooked_function(thisptr, edx)

    local breakers = ui_handler.elements["aa"]["model_breakers"]

    if not ui_handler.elements["aa"]["enable"] then
        return
    end
    
    local player = entity.get_local_player()

    if player == nil or ffi.cast("uintptr_t", thisptr) == nil or ffi_handler.get_entity_address(player:get_index()) ~= thisptr then
        return
    end

    local in_air = conditional_antiaims.player_state == conditional_antiaims.states.air or conditional_antiaims.player_state == conditional_antiaims.states.air_crouch

    if breakers["On Ground"] then
        if ui_handler.elements["aa"]["model_breakers_breaked_legs"] == "Static" then
            neverlose_refs.legs:set("Sliding")
            player.m_flPoseParameter[0] = 1
        elseif ui_handler.elements["aa"]["model_breakers_breaked_legs"] == "Walking" then
            neverlose_refs.legs:set("Walking")
            player.m_flPoseParameter[7] = 0
        elseif ui_handler.elements["aa"]["model_breakers_breaked_legs"] == "Sliding" then
            neverlose_refs.legs:set("Sliding")
            player.m_flPoseParameter[10] = 0
        end
    end
    
    if breakers["In Air"] then
        if ui_handler.elements["aa"]["model_breakers_static_legs"] == "Static" then
            player.m_flPoseParameter[6] = 1
        elseif ui_handler.elements["aa"]["model_breakers_static_legs"] == "Walking" and in_air then
            ffi.cast("CAnimationLayer**", ffi.cast("uintptr_t", thisptr) + 0x2990)[0][6].m_flWeight = 1
        elseif ui_handler.elements["aa"]["model_breakers_static_legs"] == "T-Pose" then
            ffi.cast("CAnimationLayer**", ffi.cast("uintptr_t", thisptr) + 0x2990)[0][4].m_flCycle = 0.4
            ffi.cast("CAnimationLayer**", ffi.cast("uintptr_t", thisptr) + 0x2990)[0][4].m_nSequence = 11
        end
    end

    if breakers["0 Pitch on Land"] then
        if not in_air and ffi.cast("CCSGOPlayerAnimationState_534535_t**", ffi.cast("uintptr_t", thisptr) + 0x9960)[0].bHitGroundAnimation then
            player.m_flPoseParameter[12] = 0.5
        end
    end

    if breakers["Sliding Slow Walk"] then
        player.m_flPoseParameter[9] = 0
    end
    if breakers["Sliding Crouch"] then
        player.m_flPoseParameter[8] = 0
    end

    if breakers["Move Lean"] and player.m_vecVelocity:length() > 3 then
        ffi.cast("CAnimationLayer**", ffi.cast("uintptr_t", thisptr) + 0x2990)[0][12].m_flWeight = 2.5
    end
end)

