conditional_antiaims.new_meta_ka4alka = safecall("new_meta_ka4alka", true, function(new_config)
    local switch = false
    local switch_ticks = defines.time_to_ticks(globals.realtime) - conditional_antiaims.current_tick

    if switch_ticks * 2 >= new_config.delay_ticks then
        switch = true
    else
        switch = false
    end

    if switch_ticks >= new_config.delay_ticks then
        conditional_antiaims.current_tick = defines.time_to_ticks(globals.realtime)
    end

    if new_config.yaw == "Delayed Switch" then
        new_config.yaw_offset = switch and new_config.right_yaw_offset or new_config.left_yaw_offset
    end
end)

